import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

import { Landing } from './Components';

function App() {
  return (
    <div>
      <Router>
        <Route exact path="/" component={Landing} />
        <Route exact path="/form" component={Landing} />
      </Router>
      {/* <Landing /> */}
    </div>
  );
}

export default App;
